import React from "react";
import bellpng from "../../Assets/Icons/bell.png";
import defaultProfile from "../../Assets/Icons/default_profile.png";
import editpen from "../../Assets/Icons/editpen.png";
import homeImg from "../../Assets/Icons/home-3.png";
import search from "../../Assets/Icons/search.png";
import "./Dashboard.css";
import GetProfile from "./ProfileComponents/GetProfile";
import { ProfileImageProvider } from "./ProfileComponents/ProfileImageContext";
import SetProfile from "./ProfileComponents/SetProfile";

const Dashboard = () => {
  return (
    <div>
      <div className="appbar-container">
        <div className="right-container">
          <img className="appbar-items" src={homeImg} alt="Home" />
          <img className="appbar-items" src={bellpng} alt="notification" />
          <img
            className="appbar-items"
            src={editpen}
            alt="notification"
            style={{ width: "30px", height: "35px", paddingBottom: "20px" }}
          />
        </div>
        <div className="input-container">
          <img src={search} alt="search"></img>
          <input></input>
          <img src={defaultProfile} alt=""></img>
        </div>
      </div>
      <ProfileImageProvider>
        <GetProfile />
        <SetProfile />
      </ProfileImageProvider>
    </div>
  );
};

export default Dashboard;
